def creat_idCrad():
    idcard_list = []
    url = 'http://sfz.uzuzuz.com/?region='+random.choice(region)+'&birthday='+str(random.randint(1966,2000))+random.choice(month)+random.choice(day_pre)+random.choice(day_b)+'&sex='+random.choice(sex)+'&num=10&r=77'
